/*
 Пирамидальная сортировка (англ. Heapsort, «Сортировка кучей»[1]) — алгоритм сортировки, работающий в худшем,
  в среднем и в лучшем случае (то есть гарантированно) за Θ(n log n) операций при сортировке n элементов.[2]
  Количество применяемой служебной памяти не зависит от размера массива (то есть, O(1)).
 Может рассматриваться как усовершенствованная сортировка пузырьком, в которой элемент всплывает (min-heap) / тонет (max-heap) по многим путям.
 */
function heapSort(arr) {
  if (arr.length == 0) return [];
  var counter = arr.length;
  var i = Math.floor(counter / 2);
  var j, k, tmp;
  while (true) {
    if (i > 0) {
      tmp = arr[--i];
    } else {
      counter--;
      if (counter == 0) {
        return arr;
      }
      tmp = arr[counter];
      arr[counter] = arr[0];
    }
    j = i;
    k = j * 2 + 1;
    while (k < counter) {
      if (k + 1 < counter && arr[k + 1].greaterThan(arr[k])) {
        k++;
      }
      if (arr[k].greaterThan(tmp)) {
        arr[j] = arr[k];
        j = k;
        k = j * 2 + 1;
      } else {
        break;
      }
    }
    arr[j] = tmp;
  }
}

function pointsSortFunction(a, b) {
  return ((a.x > b.x) ? 1 : (a.x < b.x) ? -1 : (a.y > b.y) ? 1 : (a.y < b.y) ? -1 : 0);
}

function Point(item) {
  if (item) {
    var tmp = item.split(' ');
    this.x = +tmp[0];
    this.y = +tmp[1];
  }
}

Point.prototype.greaterThan = function(anotherPoint) {
  return pointsSortFunction(this, anotherPoint) === 1;
}


function getAnswer() {
  var arr = lines.map((item) => new Point(item));

  var sortedArr = heapSort(arr);

  return sortedArr.map((item) => `${item.x} ${item.y}`).join('\n');
}

rl.on('line', function(line) {
  if (!numOfLines) {
    return numOfLines = +line;
  }

  lines.push(line);
  if (lines.length === numOfLines) {
    var testData = `${numOfLines}|${lines.join('|')}`;
    if(knownTests.indexOf(testData) < 0) {
      // throw testData;
    }

    return console.log(getAnswer());
  }
});
